pragma solidity ^0.6.4;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract MultiBtcWrapper is ERC20, Ownable {
    using SafeMath for uint256;
    using SafeERC20 for ERC20;

    address[] public supportedBtcVariants;
    mapping (address=>bool) isSupported;

    uint256 public feeInBips;
    uint256 public FEE_BASE = 10000;

    address public feeCollector;
    address public pendingFeeCollector;

    constructor(address[] memory _btcVariants, uint256 _feeInBips) ERC20("MultiBtcWrapper", "MBW") public {
        for (uint i = 0; i < _btcVariants.length; i++) {
            isSupported[_btcVariants[i]] = true;
        }
        supportedBtcVariants = _btcVariants;
        feeCollector = _msgSender();
        feeInBips = _feeInBips;
        _setupDecimals(8);
    }

    function updatePendingFeeCollector(address _newFeeCollector) public {
        require(_msgSender() == feeCollector, "MultiBtcWrapper: caller is not the feeCollector");
        pendingFeeCollector = _newFeeCollector;
    }

    function updateFeeCollector() public {
        require(_msgSender() == pendingFeeCollector, "MultiBtcWrapper: caller is not the pendingFeeCollector");
        feeCollector = pendingFeeCollector;
        pendingFeeCollector = address(0x0);
    }

    function deposit(address _btcVariant, uint256 _amount) public {
        require(isSupported[_btcVariant], "Btc variant is not supported");
        ERC20(_btcVariant).transferFrom(msg.sender, address(this), _amount);
        _mint(msg.sender, _amount);
    }

    function withdraw(address _btcVariant, uint256 _amount) public returns (uint256) {
        require(isSupported[_btcVariant], "Btc variant is not supported");
        _burn(msg.sender, _amount);
        uint256 fee = calculateFee(_amount);
        ERC20(_btcVariant).transfer(msg.sender, _amount.sub(fee));
        ERC20(_btcVariant).transfer(feeCollector, fee);
        return _amount.sub(fee);
    }

    function swap(address _fromBtcVariant, address _toBtcVariant, uint256 _amount) public returns (uint256) {
        deposit(_fromBtcVariant, _amount);
        return withdraw(_toBtcVariant, _amount);
    }

    function calculateFee(uint256 _amount) public view returns (uint256) {
        return (_amount.mul(feeInBips)).div(FEE_BASE);
    }
}
